  \"Starch gel and cellulose acetate electrophoretic analysis of allozyme frequencies
  in barn swallow (Hirundo rustica) populations at a dioxin contaminated site in northern
  Louisiana\",\n\t\"tracking_summary\": {\n\t\t\"total\": 14,\n\t\t\"recent\": 0\n\t},\n\t\"groups\":
  [],\n\t\"relationships_as_subject\": [],\n\t\"revision_timestamp\": \"2016-07-27T22:42:21.569803\",\n\t\"name\":
  \"starch-gel-and-cellulose-acetate-electrophoretic-analysis-of-allozyme-frequencies-in-barn-\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This study compared the genetic variability
  of Louisiana barn swallows at a dioxin-contaminated wetland to two reference populations.
  Allozyme frequencies, determined by starch gel/cellulose acetate electrophoresis,
  were used to compare genetic variation. This was the first study of this type using
  avian species, the results failed to show genetic alteration in the potentially
  contaminated population compared to the reference populations. The barn swallows
  from the contaminated site were genetically more similar to one of the reference
  populations than were the reference populations to each other.\",\n\t\"license_title\":
